-- Volcando estructura para procedimiento iparsex.getPersonasAll
DROP PROCEDURE IF EXISTS `getPersonasAll`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `getPersonasAll`(IN `pLimite` INT)
    COMMENT 'Devuelve toda la lista de personas'
BEGIN

select
p.`id` as persona_id,
p.`rol_id`,
p.`nombre`,
p.`dni`,
p.`pass`,
p.`fecha_nacimiento`,
p.`observaciones`,
p.`email`,
r.`nombre` as rol_nombre,
r.`descripcion` as rol_descripcion,
r.`codigo` as rol_codigo
from persona AS p INNER JOIN `rol` AS r ON p.`rol_id` = r.`id`
order by p.`id` LIMIT pLimite;

END//
DELIMITER ;


