-- Volcando estructura para procedimiento iparsex.searchPersonas
DROP PROCEDURE IF EXISTS `searchPersonas`;
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `searchPersonas`(IN `pdato` VARCHAR(250))
    COMMENT 'Devuelve las personas según el parámetro pasado'
BEGIN
select
p.`id` as persona_id,
p.`rol_id`,
p.`nombre`,
p.`dni`,
p.`pass`,
p.`fecha_nacimiento`,
p.`observaciones`,
p.`email`,
r.`nombre` as rol_nombre,
r.`descripcion` as rol_descripcion,
r.`codigo` as rol_codigo
from persona AS p INNER JOIN `rol` AS r ON p.`rol_id` = r.`id`
WHERE 
	dni = pdato
	or pass = pdato	
	or p.nombre like CONCAT('%', pdato , '%')
	or r.nombre like CONCAT('%', pdato , '%')
	or observaciones like CONCAT('%', pdato , '%')
	or fecha_nacimiento like CONCAT('%', pdato , '%')
	or email like CONCAT('%', pdato , '%')
	or descripcion like CONCAT('%', pdato , '%')
	or codigo like CONCAT('%', pdato , '%')
ORDER BY p.`id`;
END//
DELIMITER ;
